import React, {useState} from "react";
import {BrowserRouter} from "react-router-dom";
import axios from "axios";

const Home = (props) => {
    const [person, setPerson] = useState({}); // 存放当前页面的数据

    const getPerson = () => {
        let username = sessionStorage.getItem("username"); // 获取用户名
        axios.get(`${HOST}:${PORT}/admins/one`, {params: {user: username}})
            .then(result => {
                setPerson(result);
            }).catch(err => {
            console.log(err);
        })
    }

    return (
        <BrowserRouter>
            <div style={{margin: "30px 20px"}}>
                <p style={{fontSize: "30px", backgroundColor: "red"}}>张三</p>
                <p style={{fontSize: "16px", backgroundColor: "pink", marginTop: "-30px"}}>超级管理员</p>
                <hr/>
                <div>
                    上次登录：
                </div>
            </div>
        </BrowserRouter>
    )
}

export default Home;
